import React from "react";
import Navbar from "./Navbar";
import Dashboard from "./Dashboard";
import Footer from "./Footer";

function App() {
  return (
    <div style={{ minHeight: "100vh", position: "relative", paddingBottom: "70px" }}>
      <Navbar />
      <Dashboard />
      <Footer />
    </div>
  );
}

export default App;
